def add_token(ticker, status, email, asset_id, description='Description', link='example.com', logo='', version=0):
    data = [{
        'type': 'string',
        'key': 'ticker_<' + asset_id + '>',
        'value': ticker
    },
        {
            'type': 'integer',
            'key': 'status_<' + asset_id + '>',
            'value': status
        },
        {
            'type': 'integer',
            'key': 'version_<' + asset_id + '>',
            'value': version
        },
        {
            'type': 'string',
            'key': 'email_<' + asset_id + '>',
            'value': email
        },

        {
            'type': 'string',
            'key': 'description_<en>_<' + asset_id + '>',
            'value': description
        },
        {
            'type': 'string',
            'key': 'link_<' + asset_id + '>',
            'value': link
        }
    ]
    if logo == '':
        data.append({
            'type': 'string',
            'key': 'logo_<' + asset_id + '>',
            'value': logo})
    else:
        data.append({
            'type': 'string',
            'key': 'logo_<' + asset_id + '>',
            'value': 'data:image/svg+xml;base64,' + logo
        })

    ticker_tx = address.dataTransaction(data, baseFee=2000000, minimalFee=2500000)

    print(ticker_tx)


